        /// <summary>
        /// פונקציה ליצירת מבחן
        /// </summary>
        /// <param name="testvm"></param>
        /// <returns></returns>
        public static bool CreateTest(TestVM testvm, int userId)
        {
            using (testitprojectEntities ctx = new testitprojectEntities())
            {
                Test test = TestCRUD.CreateTest(ctx, testvm, userId);
                foreach (var quest in testvm.questionArr)
                {
                    quest.categoryId = testvm.categoriId;
                    var question = QuestionCRUD.CreateQuestion(ctx, quest, userId);
                    foreach (var ans in quest.Answers)
                    {
                        if (ans.answerDescription != null)
                            AnswerCRUD.CreateAnswer(ctx, question, ans);
                    }
                    QuestionForTestCRUD.CreateQuestionForTest(ctx, question, test, quest.nikud);
                }
                List<StudentForCourse> st = new List<StudentForCourse>();
                st = ctx.StudentForCourses.Where(t => t.courseId == -1).ToList();
                if (st != null)
                {
                    for (int i = 0; i < st.Count(); i++)
                    {
                        st[i].courseId = test.testId;
                    }
                }
                ctx.SaveChanges();
                return true;
            }
        }

        public static bool EditTest(TestVM testvm, int userId)
        {
            using (testitprojectEntities ctx = new testitprojectEntities())
            {
                //אם אין תלמידים שכבר ביצעו מבחן זה
                if (ctx.TestForStudents.FirstOrDefault(t => testvm.testId == t.testId) == null)
                {
                    Test test = ctx.Tests.FirstOrDefault(t => t.testId == testvm.testId);
                    if (testvm.name != null)
                        test.name = testvm.name;//עדכון שם
                    List<QuestionforTest> queToRemove = ctx.QuestionforTests.Where(q => q.testid == testvm.testId).ToList();
                    ctx.QuestionforTests.RemoveRange(queToRemove);
                    ctx.SaveChanges();
                    test.QuestionforTests = null;
                    foreach (var quest in testvm.questionArr)
                    {
                        quest.categoryId = testvm.categoriId;
                        var question = QuestionCRUD.CreateQuestion(ctx, quest, userId);
                        foreach (var ans in quest.Answers)
                        {
                            if (ans.answerDescription != null)
                                AnswerCRUD.CreateAnswer(ctx, question, ans);
                        }
                        QuestionForTestCRUD.CreateQuestionForTest(ctx, question, test, quest.nikud);
                    }
                    List<StudentForCourse> st = new List<StudentForCourse>();
                    st = ctx.StudentForCourses.Where(t => t.courseId == -1).ToList();
                    if (st != null)
                    {
                        for (int i = 0; i < st.Count(); i++)
                        {
                            st[i].courseId = test.testId;
                        }
                    }
                    ctx.SaveChanges();
                    return true;
                }
              
            }
            return false;
        }

        /// <summary>
        ///ID שליפת מבחן לפי
        /// </summary>
        /// <param name="testId"></param>
        /// <returns></returns>
        public static TestVM GetByTestId(int testId)
        {

            using (testitprojectEntities ctx = new testitprojectEntities())
            {
                TestVM test = new TestVM();
                Test t = TestCRUD.ReadTestById(ctx, testId);
                test.name = t.name;
                test.testId = t.testId;
                test.categoriId = t.categoriId;
                test.questionArr = new List<QuestionVM>();
                foreach (var quenstion in t.QuestionforTests)
                {
                    List<Answer> answers = ctx.Answers.Where(ans => ans.questionId == quenstion.questionId).ToList();
                    List<AnswerVM> answersvm = new List<AnswerVM>();
                    foreach (var item in answers)
                    {
                        answersvm.Add(new AnswerVM()
                        {
                            answerDescription = item.answerDescription,
                            answerId = item.answerId,
                            isCorrect = item.isCorrect

                        });
                    }
                    test.questionArr.Add(new QuestionVM()
                    {
                        isPrivate = false,
                        questionDescription = quenstion.Question.questionDescription,
                        Answers = answersvm,
                        nikud = quenstion.nikod,
                        categoryId = quenstion.Question.categoriId,
                        questionId = quenstion.questionId
                    });

                }

                return test;

            }
        }

        public static bool TestSaved(TestToSave test)
